import React, {Component} from 'react';
import './App.css';
import Nav from "./Components /Nav";
import Home from "./Components /Home"
import {BrowserRouter, Route } from 'react-router-dom';

class App extends Component {
  render(){
    return (
      <BrowserRouter>
        <div className="App">
          <Nav />
          <Route path="/" component={Home}/>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
